import React, { Component } from 'react';

class OtherContentsIdentifire extends Component {
    constructor(props) {
        super(props)
        this.state = {

        }
    }

    render() {
        const { contents } = this.props;
        let subType = contents.sub_type;

        if (subType === 'video')
            return (
                <div className='card mb-1'>
                    <div className='card-body p-3'>
                        <img className='home-center-series-videos-large'
                            src={match.med_image} alt="no Iamge" />
                        <div className="home-center-videos-title">
                            {match.title}
                        </div>
                    </div>
                </div>
            );

        if (subType === 'news')
            return (
                <div className='card'>
                    <div calssName='card-title'>
                        {contents.title}
                    </div>
                </div>

            );

        if (subType === 'article')
            return (
                <div className='card'>
                    <div calssName='card-title'>
                        {contents.title}
                    </div>
                </div>

            );
    }
}

export default OtherContentsIdentifire;
